повідомила, що були проведені електроні закупівлі на сайті www.SmartTender. Участь в  аукціоні №184434 від 21.06.2016 року «Чоловічий верхній головний убір» прийняли наступні учасники:
-	ТОВ «Журавка Торг» - запропонована сума 1800,00 грн.;
-	Туристично-комерційне товариство з обмеженою відповідальністю «Схід» - запропонована сума 2875,00 грн.;
-	ТОВ «Лев-Сервіс К» - запропонована сума 2900,00 грн.;
-	ТОВ «Торговий Дім «Еней» - запропонована сума 3000,00 грн.;
-	ТОВ «С-Мастер» - запропонована сума 3375,00 грн.;
      Згідно умов договору, учасники присилали зразки продукції для достовірності якісних характеристик товару. Враховуючи якість товару (основний критерій) та співвідношення цінових пропозицій електронної закупівлі кепок, комісія визначила переможця Туристично-комерційне товариство з обмеженою відповідальністю «Схід» із запропонованою сумою – 2875,00 грн. (Дві тисячі вісімсот сімдесят п’ять грн. 00 коп.), де найвигідніше співвідносяться ціна та якість товарів. 
ВИРІШИЛИ: Визнати переможцем аукціону №184434 від 21.06.2016 року - Туристично-комерційне товариство з обмеженою відповідальністю «Схід».

